import LogoPizza from '../assets/pizza.png';

const HomePage = () => {
  return (
    <div style={{ height: 'calc(100vh - 293px)', padding: '4rem 4rem', overflowY: 'auto' }}>
      <div className="wrapper-card-items">
        <div className="card-items">
          <img src={LogoPizza} width="200px" alt="9DevPizza" style={{ position: 'absolute', top: '-90px' }} />
        </div>
        <div className="card-items"></div>
        <div className="card-items"></div>
        <div className="card-items"></div>
        <div className="card-items"></div>
        <div className="card-items"></div>
        <div className="card-items"></div>
        <div className="card-items"></div>
        <div className="card-items"></div>
      </div>
    </div>
  )
};

export default HomePage;
